import { FaRegCheckCircle} from "react-icons/fa"

const Camposerviço = (props) => {
    return ( 
        <div className="camposerviço-container"><p>{props.serviço}</p><FaRegCheckCircle className="check-icon" />
        </div>
     );
}
 
export default Camposerviço;
